            var values = [];

            $.each($("#selectedType option:selected"), function () {
                var value = $(this).val()
                if (value.length >= 0) {
                    values.push(value);
                }
            });

            var links = [];
            var nodes = [];
            for (var i = 0; i < values.length; i++) {
                json.linkDataArray
                    .filter(item => item.from === values[i] || item.to === values[i])
                    .forEach(item => links.push(item));
            }
            links.forEach(item => {
                if (nodes.findIndex(n => n.key === item.from) === -1) {
                    nodes.push({ "key": item.from, "text": item.from });
                }
                if (nodes.findIndex(n => n.key === item.to) === -1) {
                    nodes.push({ "key": item.to, "text": item.to});
                }
            });
            for (var i = 0; i < values.length; i++) {
                if (nodes.findIndex(item => item.key === values[i]) === -1) {
                    nodes.push({ "key": values[i], "text": values[i] });
                }
            }
            var model = {
                "class": "go.GraphLinksModel",
                "nodeDataArray": nodes,
                "linkDataArray": links
            };
            myDiagram.model = go.Model.fromJson(model);
        }
        function init() {
            var $ = go.GraphObject.make;
            myDiagram =
                $(go.Diagram, "myDiagramDiv",
                    {
                        initialContentAlignment: go.Spot.Center,
                        "clickCreatingTool.archetypeNodeData": {},
                        "undoManager.isEnabled": true
                    });
            myDiagram.nodeTemplate =
                $(go.Node, "Spot",
                    { locationSpot: go.Spot.Center, locationObjectName: "SHAPE" },
                    new go.Binding("location", "loc", go.Point.parse).makeTwoWay(go.Point.stringify),
                    $(go.Shape, "Circle",
                        {
                            name: "SHAPE", fill: "steelblue", width: 40, height: 40,
                            // allow users to draw links to and from this circle
                            portId: "", cursor: "pointer",
                            fromLinkable: true, toLinkable: true,
                            fromLinkableDuplicates: true, toLinkableDuplicates: true,
                            fromLinkableSelfNode: true, toLinkableSelfNode: true
                        }),
                    $(go.TextBlock, "abc",
                        { alignment: new go.Spot(0.5, 0.5, 0, -30), editable: true },
                        // TwoWay Binding automatically remembers text edits
                        new go.Binding("text").makeTwoWay())
                );
            myDiagram.linkTemplate =
                $(go.Link,
                    { relinkableFrom: true, relinkableTo: true },
                    $(go.Shape, { stroke: "steelblue", strokeWidth: 1.5 }),
                    $(go.Shape, { toArrow: "OpenTriangle", stroke: "steelblue" })
                );
        }
        init();
